def _get_grouper(
    obj,
    key=None,
    axis=0,
    level=None,
    sort=True,
    observed=False,
    mutated=False,
    validate=True,
):
    group_axis = obj._get_axis(axis)

    if isinstance(key, list):
        groupings = []
        exclusions = []

        for k in key:
            if isinstance(k, Grouper):
                binner, grouper, obj = k._get_grouper(obj, validate=False)
                if k.key is None:
                    groupings.append(grouper)
                    exclusions.append({})
                else:
                    groupings.append(grouper)
                    exclusions.append({k.key})
            else:
                raise KeyError(k)
    else:
        if isinstance(key, Grouper):
            binner, grouper, obj = key._get_grouper(obj, validate=False)
            if key.key is None:
                return grouper, [], obj
            else:
                return grouper, {key.key}, obj
        elif isinstance(key, BaseGrouper):
            return key, [], obj
        else:
            raise KeyError(key)

    return BaseGrouper(group_axis, groupings, sort=sort, mutated=mutated), exclusions, obj
